import React from "react";
import NavigationBar from "../component/NavigationBar";

const Layout = ({ children }) => {
  return (
    <React.Fragment>
      <NavigationBar />
      {children}
      <p>Footer</p>
    </React.Fragment>
  );
};

export default Layout;
